import React from 'react';
import style from './style.module.scss';
import Details from './buttons';

const Buttons = () => {
    const object = [1, 2, 3, 4, 5, 6, 7, 8, 9, 0, '00'];
    const object2 = ['*', '/', '+', '-', '='];
    const map2 = object2.map((item, idx) => <li key={idx}><Details>{item}</Details></li>)
    const map = object.map((item, idx) => <li key={idx}>{item}</li>)
    return (
        <div className={style.Buttons}>
            <ul>
                {map}
            </ul>
            <ul>
                {map2}
            </ul>
        </div>
    )
}

export default Buttons;
